import React from 'react';
import { Button, Card } from 'antd';

const UserProfile = () => {
    return(
        <Card
            actions={[
                <>
                    <div key="twit">개시글<br/>0</div>
                    <div key="faoolwings">팔로잉<br/>0</div>
                    <div key="followers">팔로워<br/>0</div>
                </>
            ]}
        >
            <Card.Meta 
                avatar={<Avatar>GO</Avatar>}
                title="gojaebeom"
            />
            <Button>로그아웃</Button>
        </Card>
    )
}

export default UserProfile;
